tables.table_schema:
CREATE TABLE user_profile (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(50),
    user_email VARCHAR(50),
    user_phone VARCHAR(15)
);

CREATE TABLE assistant_profile (
    assistant_id INT PRIMARY KEY,
    assistant_name VARCHAR(50),
    assistant_type VARCHAR(50),
    assistant_version VARCHAR(20)
);

CREATE TABLE assistant_performance (
    assistant_id SERIAL PRIMARY KEY,
    total_interactions INT NOT NULL,
    average_response_time FLOAT,
    error_rate FLOAT
);
